import React from 'react';
import s from './Navk.scss';
import logok2 from '../../img/logok2.svg'


const nav = () => (
<nav className={s.nav}>
    <div>
        <a>
            <img src={logok2}></img>
        </a>
    </div>
</nav>);

export default nav;
